import React from 'react'
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const Contact = ({formData, setForm, navigation}) => {
    const {phone, email} = formData;
   
    return (
      <Container maxWidth="xs">
          <h1>Contact Info</h1>
            {/* phone */}
        <TextField   label="phone" name="phone" value={phone} onChange={setForm} margin="normal" variant="outlined" autoComplete="off" fullWidth/>
        {/* email */}
        <TextField   label="Email" name="email" value={email} onChange={setForm} margin="normal" variant="outlined" autoComplete="off" fullWidth/>

         {/* Buttons */}
       <div style={{ marginTop: "1rem" }}>
           {/* Back */}
        <Button color="secondary" variant="contained" style={{ marginRight: "1rem" }} onClick={() => navigation.previous()}> Back</Button>

        {/* Next */}
        <Button color="primary" variant="contained" onClick={() => navigation.next()}> Next
         </Button>
      </div>

      </Container>
    )
}

export default Contact
